    varying vec3 vColor;
#endif

void main() {
    
    vec3 objectNormal = vec3(normal);
    vec3 transformed = vec3(position);
    
    #ifdef USE_SKINNING
        mat4 boneMatX = getBoneMatrix(skinIndex.x);
