precision mediump float;

#define GAMMA_FACTOR 2
#define SHADOW_BIAS .004

#define LOG2 1.442695
#define PI 3.14159265359
#define RECIPROCAL_PI 0.31830988618
#define whiteCompliment(a) (1.0 - saturate(a))
#define saturate(a) clamp(a, 0.0, 1.0)

struct GeometricContext { 
	vec3 position;
	vec3 normal;
	vec3 viewDir; 
};

struct IncidentLight {
	vec3 color;
	vec3 direction;
	bool visible;
};

struct ReflectedLight {
	vec3 directDiffuse;
	vec3 directSpecular;
	vec3 indirectDiffuse;
	vec3 indirectSpecular;
};

struct DirectionalLight {
	vec3 direction;
	vec4 color;
	bool shadow;
	int shadowType;
	float shadowRadius;
	float intensity;
};

struct BlinnPhongMaterial {
	vec3	diffuseColor;
	vec3	specularColor;
	float	specularShininess;
	float	specularStrength;
}; 

vec4 GammaToLinear( in vec4 value, in float gammaFactor ) {
	return vec4( pow( value.xyz, vec3( gammaFactor ) ), value.w );
}
vec4 LinearToGamma( in vec4 value, in float gammaFactor ) { 
	return vec4( pow( value.xyz, vec3( 1.0 / gammaFactor ) ), value.w );
}

vec4 mapTexelToLinear( vec4 value ) { return GammaToLinear( value, float( GAMMA_FACTOR ) ); }
vec4 linearToOutputTexel( vec4 value ) { return LinearToGamma( value, float( GAMMA_FACTOR ) ); }

void getDirectionalDirectLightIrradiance( const in DirectionalLight directionalLight, const in GeometricContext geometry, out IncidentLight directLight ) {
	directLight.color = directionalLight.color.rgb;
	directLight.direction = directionalLight.direction;
	directLight.visible = true;
}

vec3 BRDF_Diffuse_Lambert( const in vec3 diffuseColor ) { 
	return RECIPROCAL_PI * diffuseColor;
}

vec3 F_Schlick( const in vec3 specularColor, const in float dotLH ) {
	float fresnel = exp2( ( -5.55473 * dotLH - 6.98316 ) * dotLH );
	return ( 1.0 - specularColor ) * fresnel + specularColor;
}

float G_BlinnPhong_Implicit( ) {
	return 0.25;
}

float D_BlinnPhong( const in float shininess, const in float dotNH ) {
    // DO NOT ALLOW 0 shininess!!!! result is undefined if so
	return RECIPROCAL_PI * ( shininess * 0.5 + 1.0 ) * pow(dotNH, max(shininess, .01));
}

vec3 BRDF_Specular_BlinnPhong( const in IncidentLight incidentLight, const in GeometricContext geometry, const in vec3 specularColor, const in float shininess ) {
	vec3 halfDir = normalize( incidentLight.direction + geometry.viewDir );
	float dotNH = saturate( dot( geometry.normal, halfDir ) );
	float dotLH = saturate( dot( incidentLight.direction, halfDir ) );
	vec3 F = F_Schlick( specularColor, dotLH );
	float G = G_BlinnPhong_Implicit( );
	float D = D_BlinnPhong( shininess, dotNH );
	return F * ( G * D );
}

void RE_Direct_BlinnPhong( const in IncidentLight directLight, const in GeometricContext geometry, const in BlinnPhongMaterial material, inout ReflectedLight reflectedLight ) {
	float dotNL = saturate( dot( geometry.normal, directLight.direction ) );
	vec3 irradiance = dotNL * directLight.color;
	#ifndef PHYSICALLY_CORRECT_LIGHTS
		irradiance *= PI;
	#endif
	reflectedLight.directDiffuse += irradiance * BRDF_Diffuse_Lambert( material.diffuseColor );
	reflectedLight.directSpecular += irradiance * BRDF_Specular_BlinnPhong( directLight, geometry, material.specularColor, material.specularShininess ) * material.specularStrength;
}

uniform vec4 diffuse;
uniform sampler2D diffuseMap;
uniform sampler2D specularMap;
uniform vec4 emissive;
uniform vec4 ambient;
uniform vec4 specular;
uniform float shininess;

uniform DirectionalLight directionalLights[MAX_DIRECTIONAL_LIGHTS];
uniform int directionalLightCount;

varying vec2 vTexCoord;
varying vec3 vNormal;
varying vec3 vViewPosition;

#ifdef USE_VERTEX_COLOR
    varying vec3 vColor;
#endif

#ifdef USE_SHADOW_MAP
	uniform sampler2D directionalShadowMaps[MAX_DIRECTIONAL_SHADOWMAPS];
	uniform mat4 directionalLightMatrices[MAX_DIRECTIONAL_SHADOWMAPS];
	uniform float shadowCascadeEdges[MAX_SHADOW_CASCADES]; // Real size is MAX_SHADOW_CASCADES-1 but must use a fixed size array
	varying vec3 vWorldSpacePos;
	varying vec4 vClipSpacePos;
    
    const vec3 PackFactors = vec3( 256. * 256. * 256., 256. * 256.,  256. );
    const float UnpackDownscale = 255. / 256.; // 0..1 -> fraction (excluding 1)
    const vec4 UnpackFactors = UnpackDownscale / vec4( PackFactors, 1. );
    float unpackRGBAToDepth( const in vec4 v ) {
    	return dot( v, UnpackFactors );
    }
    
    float texture2DCompare(sampler2D depths, vec2 uv, float compare) {
    	return step(compare, unpackRGBAToDepth(texture2D(depths, uv)));
    }
    
    float texture2DShadowLerp( sampler2D depths, vec2 size, vec2 uv, float compare ) {
    	const vec2 offset = vec2( 0.0, 1.0 );
    	vec2 texelSize = vec2( 1.0 ) / size;
    	vec2 centroidUV = floor( uv * size + 0.5 ) / size;
    	float lb = texture2DCompare( depths, centroidUV + texelSize * offset.xx, compare );
    	float lt = texture2DCompare( depths, centroidUV + texelSize * offset.xy, compare );
    	float rb = texture2DCompare( depths, centroidUV + texelSize * offset.yx, compare );
    	float rt = texture2DCompare( depths, centroidUV + texelSize * offset.yy, compare );
    	vec2 f = fract( uv * size + 0.5 );
    	float a = mix( lb, lt, f.y );
    	float b = mix( rb, rt, f.y );
    	float c = mix( a, b, f.x );
    	return c;
    }

    float getShadow(in sampler2D shadowMap, in vec2 shadowMapSize, in vec4 shadowCoord, in DirectionalLight light) {
		float shadow = 1.;
		// convert to normalized device coords (NDC)
		shadowCoord.xyz /= shadowCoord.w; 
		// convert to [0 - 1] sampler space
		shadowCoord.xyz = shadowCoord.xyz * 0.5 + 0.5;
		shadowCoord.z -= SHADOW_BIAS;
		bvec4 inFrustumVec = bvec4 ( shadowCoord.x >= 0.0, shadowCoord.x <= 1.0, shadowCoord.y >= 0.0, shadowCoord.y <= 1.0 );
		bool inFrustum = all( inFrustumVec );
		bvec2 frustumTestVec = bvec2( inFrustum, shadowCoord.z < .99 );
		bool frustumTest = all( frustumTestVec );
		if ( frustumTest ) {
			if (light.shadowType == 0) {
				// PCF soft
				vec2 texelSize = vec2( 1.0 ) / shadowMapSize;
				float dx0 = - texelSize.x * light.shadowRadius;
				float dy0 = - texelSize.y * light.shadowRadius;
				float dx1 = + texelSize.x * light.shadowRadius;
				float dy1 = + texelSize.y * light.shadowRadius;
				shadow = (
					texture2DShadowLerp( shadowMap, shadowMapSize, shadowCoord.xy + vec2( dx0, dy0 ), shadowCoord.z ) +
					texture2DShadowLerp( shadowMap, shadowMapSize, shadowCoord.xy + vec2( 0.0, dy0 ), shadowCoord.z ) +
					texture2DShadowLerp( shadowMap, shadowMapSize, shadowCoord.xy + vec2( dx1, dy0 ), shadowCoord.z ) +
					texture2DShadowLerp( shadowMap, shadowMapSize, shadowCoord.xy + vec2( dx0, 0.0 ), shadowCoord.z ) +
					texture2DShadowLerp( shadowMap, shadowMapSize, shadowCoord.xy, shadowCoord.z ) +
					texture2DShadowLerp( shadowMap, shadowMapSize, shadowCoord.xy + vec2( dx1, 0.0 ), shadowCoord.z ) +
					texture2DShadowLerp( shadowMap, shadowMapSize, shadowCoord.xy + vec2( dx0, dy1 ), shadowCoord.z ) +
					texture2DShadowLerp( shadowMap, shadowMapSize, shadowCoord.xy + vec2( 0.0, dy1 ), shadowCoord.z ) +
					texture2DShadowLerp( shadowMap, shadowMapSize, shadowCoord.xy + vec2( dx1, dy1 ), shadowCoord.z )
				) / 9.;
			} else if (light.shadowType == 1) {
				// PCF
				vec2 texelSize = vec2( 1.0 ) / shadowMapSize;
				float dx0 = - texelSize.x * light.shadowRadius;
				float dy0 = - texelSize.y * light.shadowRadius;
				float dx1 = + texelSize.x * light.shadowRadius;
				float dy1 = + texelSize.y * light.shadowRadius;
				shadow = (
					texture2DCompare( shadowMap, shadowCoord.xy + vec2( dx0, dy0 ), shadowCoord.z ) +
					texture2DCompare( shadowMap, shadowCoord.xy + vec2( 0.0, dy0 ), shadowCoord.z ) +
					texture2DCompare( shadowMap, shadowCoord.xy + vec2( dx1, dy0 ), shadowCoord.z ) +
					texture2DCompare( shadowMap, shadowCoord.xy + vec2( dx0, 0.0 ), shadowCoord.z ) +
					texture2DCompare( shadowMap, shadowCoord.xy, shadowCoord.z ) +
					texture2DCompare( shadowMap, shadowCoord.xy + vec2( dx1, 0.0 ), shadowCoord.z ) +
					texture2DCompare( shadowMap, shadowCoord.xy + vec2( dx0, dy1 ), shadowCoord.z ) +
					texture2DCompare( shadowMap, shadowCoord.xy + vec2( 0.0, dy1 ), shadowCoord.z ) +
					texture2DCompare( shadowMap, shadowCoord.xy + vec2( dx1, dy1 ), shadowCoord.z )
				) / 9.;
			} else {
				// Hard shadow
				shadow = texture2DCompare( shadowMap, shadowCoord.xy, shadowCoord.z );
			}		
		}
		return shadow;
	}
#endif

#ifdef USE_FOG
	uniform vec4 fogColor;
	varying float vFogDepth;
	#ifdef USE_EXPONENTIAL_FOG
		uniform float fogDensity;
	#else
		uniform float fogNear;
		uniform float fogFar;
	#endif
#endif

void main() {
    
    vec4 diffuseColor = diffuse;
    vec4 texelColor = texture2D(diffuseMap, vTexCoord);
	texelColor = mapTexelToLinear(texelColor);
	diffuseColor *= texelColor;
	
	#ifdef USE_VERTEX_COLOR
	    diffuseColor.rgb *= vColor;
	#endif
	
	float specularStrength;
	
    #ifdef USE_SPECULARMAP
	    vec4 texelSpecular = texture2D(specularMap, vTexCoord);
	    specularStrength = texelSpecular.r;
    #else
    	specularStrength = 1.0;
    #endif
    
    vec3 normal = normalize(vNormal);
    
    BlinnPhongMaterial material;
    material.diffuseColor = diffuseColor.rgb;
    material.specularColor = specular.rgb;
    material.specularShininess = shininess;
    material.specularStrength = specularStrength;
    
    GeometricContext geometry;
    geometry.position = -vViewPosition;
    geometry.normal = normal;
    geometry.viewDir = normalize(vViewPosition);

	// Loop through lights
	vec3 totalOutgoingLight = vec3(0.);
	for (int i = 0 ; i < MAX_DIRECTIONAL_LIGHTS; ++i) {
		if (i == directionalLightCount) {
			break;
		}
		
    	IncidentLight directLight;
		DirectionalLight directionalLight = directionalLights[i];
    	getDirectionalDirectLightIrradiance(directionalLight, geometry, directLight);
		directLight.color *= directionalLight.intensity;
    	#ifdef USE_SHADOW_MAP
			float shadow = 1.;
			if (vClipSpacePos.z < shadowCascadeEdges[0]) {
				vec4 lightSpacePos = directionalLightMatrices[i * 3] * vec4(vWorldSpacePos, 1.0);
				shadow = all(bvec2(directionalLight.shadow, directLight.visible))
				? getShadow(directionalShadowMaps[i * MAX_SHADOW_CASCADES], vec2(4096.), lightSpacePos, directionalLight)
				: 1.0;
			} else if (vClipSpacePos.z < shadowCascadeEdges[1]) {
				vec4 lightSpacePos = directionalLightMatrices[i * 3 + 1] * vec4(vWorldSpacePos, 1.0);
				shadow = all(bvec2(directionalLight.shadow, directLight.visible))
				? getShadow(directionalShadowMaps[i * MAX_SHADOW_CASCADES + 1], vec2(4096.), lightSpacePos, directionalLight)
				: 1.0;
			} else {
				vec4 lightSpacePos = directionalLightMatrices[i * 3 + 2] * vec4(vWorldSpacePos, 1.0);
				shadow = all(bvec2(directionalLight.shadow, directLight.visible))
				? getShadow(directionalShadowMaps[i * MAX_SHADOW_CASCADES + 2], vec2(2048.), lightSpacePos, directionalLight)
				: 1.0;
			}
    	    directLight.color *= clamp(shadow, 0., 1.);
    	#endif

		ReflectedLight reflectedLight = ReflectedLight(vec3(0.0), vec3(0.0), vec3(0.0), vec3(0.0));
    	RE_Direct_BlinnPhong(directLight, geometry, material, reflectedLight);
    	vec3 totalEmissiveRadiance = emissive.rgb;
    	vec3 totalAmbient = ambient.rgb * material.diffuseColor;
    	vec3 outgoingLight = reflectedLight.directDiffuse 
			+ reflectedLight.indirectDiffuse 
			+ reflectedLight.directSpecular 
			+ reflectedLight.indirectSpecular 
			+ totalEmissiveRadiance 
			+ totalAmbient;    
		totalOutgoingLight += outgoingLight;
	}

    gl_FragColor = vec4(totalOutgoingLight, diffuseColor.a);
    gl_FragColor = linearToOutputTexel(gl_FragColor);
    
#ifdef USE_FOG
	#ifdef USE_EXPONENTIAL_FOG
		float fogFactor = whiteCompliment(exp2(-fogDensity * fogDensity * vFogDepth * vFogDepth * LOG2));
	#else
		float fogFactor = smoothstep(fogNear, fogFar, vFogDepth);
	#endif
	gl_FragColor.rgb = mix(gl_FragColor.rgb, fogColor.rgb, fogFactor);
